import React, { useState } from "react";
import axios from 'axios';
import { Image, PageHeader, Thumbnail } from "react-bootstrap";
import "./profile.css";

export default function Profile(props) {
  const [firstName, setFirstName] = useState("Kevin");
  const [lastName, setLastName] = useState("Kim");
  const [biography, setBiography] = useState("");
  const [college, setCollege] = useState("");
  const [skills, setSkills] = useState("");
  const [picture, setPicture] = useState("/profile.png");
  const [resume, setResume] = useState("");

  return (
    <div className="Profile">
      <PageHeader>
        {firstName} {lastName}
      </PageHeader>
      <div className="photo">
        <Thumbnail src={picture} />
      </div>
    </div>
  );
}
